import React, { Component } from "react";
import { connect } from "react-redux";

import SignOutMenu from '../components/SignOutMenu';

class SignOutContainer extends Component {

  logout= () => {
    console.log('logout')
  };

  render() {
    return (
        <SignOutMenu />
    );
  }
}

export default connect(
  null
)(SignOutContainer);
